public void updateDesign()
{
    if (    FBContribAssetTable_BR.AssetAppropriationMethod == FBPISCOFINSFixedAssetAppropMethod_BR::Depreciation
        ||  FBContribAssetTable_BR.AssetAppropriationMethod == FBPISCOFINSFixedAssetAppropMethod_BR::Amortization)
    {
        Installments.visible(false);
        Grid_InstallmentNum.visible(false);
        Amounts.visible(false);
    }
    else
    {
        Installments.visible(true);
        Grid_InstallmentNum.visible(true);
        Amounts.visible(true);
    }
}

public int active()
{
    int ret;

    ret = super();

    FBContribAssetTable_BR_ds.allowEdit(FBContribAssetTable_BR.Status != FBCIAPAssetStatus_BR::Closed);

    FBContribAssetTable_BR_ds.object(fieldNum(FBContribAssetTable_BR, PISAmount))          .allowEdit(FBContribAssetTable_BR.Status == FBCIAPAssetStatus_BR::NoAcquisition);
    FBContribAssetTable_BR_ds.object(fieldNum(FBContribAssetTable_BR, PISTaxBaseAmount))   .allowEdit(FBContribAssetTable_BR.Status == FBCIAPAssetStatus_BR::NoAcquisition);
    FBContribAssetTable_BR_ds.object(fieldNum(FBContribAssetTable_BR, COFINSAmount))       .allowEdit(FBContribAssetTable_BR.Status == FBCIAPAssetStatus_BR::NoAcquisition);
    FBContribAssetTable_BR_ds.object(fieldNum(FBContribAssetTable_BR, COFINSTaxBaseAmount)).allowEdit(FBContribAssetTable_BR.Status == FBCIAPAssetStatus_BR::NoAcquisition);

    this.updateDesign();

    return ret;
}
